    return(
        <div className="register">
        <h1>Signup</h1>
        <input type="text" placeholder="Enter name" className="inputBox" onChange={(e)=> setName(e.target.value)} value={name}/>
        <input type="text" placeholder="Enter email" className="inputBox" onChange={(e)=> setName(e.target.value)} value={name}/>
        <input type="password" placeholder="Enter password" className="inputBox"/>
        <button className="appButton">Signup</button>
        </div>
    )
}

export default Signup;
